import React from "react";
import {
  Button,
  Header,
  Icon,
  Image,
  Menu,
  Segment,
  Sidebar
} from "semantic-ui-react";
import { connect } from "react-redux";
import { fetchFullAnnot } from "../actions";

class AnnotSidebar extends React.Component {
  render() {
    return (
      <div>
        <Menu.Item as="a">
          <Icon name="home" />
          Home
        </Menu.Item>
        <Menu.Item as="a">
          <Icon name="gamepad" />
          Games
        </Menu.Item>
        <Menu.Item as="a">
          <Icon name="camera" />
          Channels
        </Menu.Item>
        <Menu.Item>
          <p>will be annots</p>
        </Menu.Item>
      </div>
    );
  }
}

const mapStateToProps = state => {
  console.log("full annot:", state.fullAnnot);
  return { fullAnnots: state.fullAnnot };
};

export default connect(
  mapStateToProps,
  { fetchFullAnnot }
)(AnnotSidebar);
